export const Navbar =() =>{
    return ( 
        <div className='nav-bar'>
            <ul>
              <Link to ="/">  <li>Mental Health</li></Link>
            <Link  to ="" > <li>Professional Development</li></Link>
            <Link to ="" >  <li>Finances</li></Link>
            <Link to="" > <li>Nutrition</li></Link>
            <Link to ="" >  <li>Mental Health</li></Link>
            <Link to ="" > <li>Professional Development</li></Link>

            </ul>

        </div>
    )

}
export default Navbar;
